INSERT INTO answer (answer_body, answer_date, misinformation, author, answer_image, question_id, highlight) VALUES ('Some companies take a preference on macbooks over other laptops but usually, it comes down to personal preference. People like macs because MacOS is a Unix underneath and the hardware is really really well built. Another thing is that in the open source community you tend to deploy on Linux servers. Unix and Linux work almost exactly the same way so stuff like shell scripts can easily be developed on your mac and then be used on Linux. Basically, the near-linux experience is the biggest reason some companies prefer macbooks over other laptops.', TIMESTAMP '2020-12-11 01:37:29', false, 46, NULL, 2, true);
INSERT INTO answer (answer_body, answer_date, misinformation, author, answer_image, question_id, highlight) VALUES ('No. Macbooks are overrated and overpriced pieces of equipment that should never be used in software development.', TIMESTAMP '2020-10-01 18:33:45', false, 92, NULL, 2, false);
INSERT INTO answer (answer_body, answer_date, misinformation, author, answer_image, question_id, highlight) VALUES ('Yes, all companies prefer macbooks. There is no reason to ever pick any other laptop over a macbook due to its convenience and near-linux experience.', TIMESTAMP '2020-11-08 04:23:37', false, 68, 1, 2, true);
INSERT INTO answer (answer_body, answer_date, misinformation, author, answer_image, question_id, highlight) VALUES ('Golden ratio, also known as the golden section, golden mean, or divine proportion, in mathematics, the irrational number (1 + Square root of 5)/2, often denoted by the Greek letters, which is approximately equal to 1.618. It is the ratio of a line segment cut into two pieces of different lengths such that the ratio of the whole segment to that of the longer segment is equal to the ratio of the longer segment to the shorter segment. The origin of this number can be traced back to Euclid, who mentions it as the “extreme and mean ratio” in the Elements. In terms of present day algebra, letting the length of the shorter segment be one unit and the length of the longer segment be x units gives rise to the equation (x + 1)/x = x/1; this may be rearranged to form the quadratic equation x2 – x – 1 = 0, for which the positive solution is x = (1 + Square root of 5)/2, the golden ratio.', TIMESTAMP '2021-03-31 21:53:00', false, 63, NULL, 3, false);
INSERT INTO answer (answer_body, answer_date, misinformation, author, answer_image, question_id, highlight) VALUES ('I dont think if the golden ratio exists..', TIMESTAMP '2021-03-30 23:19:23', false, 58, 2, 3, false);
INSERT INTO answer (answer_body, answer_date, misinformation, author, answer_image, question_id, highlight) VALUES ('We find the golden ratio when we divide a line into two parts so that: the long part divided by the short part is also equal to the whole length divided by the long part.', TIMESTAMP '2021-04-01 17:34:13', false, 38, NULL, 3, false);
INSERT INTO answer (answer_body, answer_date, misinformation, author, answer_image, question_id, highlight) VALUES ('Every audio sample has whats known as an "acoustic fingerprint", which (like a human fingerprint) is basically a way to identify music based on things like tempo, bandwidth, and other audio features.\nIt then compares that acoustic fingerprint to the ones in their database, and if there is a "close enough" match, it returns the matched song information.', TIMESTAMP '2021-01-15 15:14:06', false, 79, NULL, 4, false);
INSERT INTO answer (answer_body, answer_date, misinformation, author, answer_image, question_id, highlight) VALUES ('Shazam identifies songs based on an audio fingerprint based on a time-frequency graph called a spectrogram. It uses a smartphone or computer´s built-in microphone to gather a brief sample of audio being played. Shazam stores a catalogue of audio fingerprints in a database. The user tags a song for 10 seconds and the application creates an audio fingerprint. Shazam works by analyzing the captured sound and seeking a match based on an acoustic fingerprint in a database of millions of songs.', TIMESTAMP '2021-03-18 16:43:39', false, 64, 3, 4, false);
INSERT INTO answer (answer_body, answer_date, misinformation, author, answer_image, question_id, highlight) VALUES ('Blockchain seems complicated, and it definitely can be, but its core concept is really quite simple. A blockchain is a type of database. To be able to understand blockchain, it helps to first understand what a database actually is.\nA database is a collection of information that is stored electronically on a computer system. Information, or data, in databases is typically structured in table format to allow for easier searching and filtering for specific information. What is the difference between someone using a spreadsheet to store information rather than a database?\nSpreadsheets are designed for one person, or a small group of people, to store and access limited amounts of information. In contrast, a database is designed to house significantly larger amounts of information that can be accessed, filtered, and manipulated quickly and easily by any number of users at once.\nLarge databases achieve this by housing data on servers that are made of powerful computers. These servers can sometimes be built using hundreds or thousands of computers in order to have the computational power and storage capacity necessary for many users to access the database simultaneously. While a spreadsheet or database may be accessible to any number of people, it is often owned by a business and managed by an appointed individual that has complete control over how it works and the data within it.\nIf you want to know more details: https://www.investopedia.com/terms/b/blockchain.asp', TIMESTAMP '2020-06-22 18:24:39', false, 65, 4, 5, false);
INSERT INTO answer (answer_body, answer_date, misinformation, author, answer_image, question_id, highlight) VALUES ('A blockchain is a digital record of transactions. The name comes from its structure, in which individual records, called blocks, are linked together in single list, called a chain. Blockchains are used for recording transactions made with cryptocurrencies, such as Bitcoin, and have many other applications.', TIMESTAMP '2020-09-14 13:35:54', false, 45, NULL, 5, false);
INSERT INTO answer (answer_body, answer_date, misinformation, author, answer_image, question_id, highlight) VALUES ('Isnt blockchain a heavy metal band? I think I heard some songs made by them..', TIMESTAMP '2020-12-05 19:07:36', false, 27, NULL, 5, true);
