INSERT INTO answer (answer_body, answer_date, misinformation, author, answer_image, question_id, highlight) VALUES ('Some companies take a preference on macbooks over other laptops but usually, it comes down to personal preference. People like macs because MacOS is a Unix underneath and the hardware is really really well built. Another thing is that in the open source community you tend to deploy on Linux servers. Unix and Linux work almost exactly the same way so stuff like shell scripts can easily be developed on your mac and then be used on Linux. Basically, the near-linux experience is the biggest reason some companies prefer macbooks over other laptops.', TIMESTAMP '2021-01-12 09:23:06', false, 12, NULL, 41, true);
