INSERT INTO answer (answer_body, answer_date, misinformation, author, answer_image, question_id, highlight) VALUES ('To answer your simply, cc stands for cubic centimeters- it represents the total capacity or volume of the cylinders in an engine(1000cc= 1L. eg. "1.2L" petrol engines,if you check their specs, you can find "engine displacement= 1193cc" or something in that range). Basically,it represents the amount of fuel-air mixture that can be injected/pumped into the engine at an instant. So, larger the cc or engine displacement,greater the power or torque developed by the engine.\nHence, cc cannot be used to describe the power of an electric powered vehicle because unlike a normal IC engine which uses a piston-cylinder arrangement (i.e.thermal energy of fuel combustion is converted to the up-down oscillations of the piston,which in turn is converted to a rotary output), electric motors produce rotary output directly.', TIMESTAMP '2021-02-21 12:09:34', false, 37, NULL, 42, false);
INSERT INTO answer (answer_body, answer_date, misinformation, author, answer_image, question_id, highlight) VALUES ('CC means carbon copy. It is an email field that allows the sender to copy a message to one or more other addresses besides the main recipient.', TIMESTAMP '2021-01-28 00:32:09', false, 95, NULL, 42, false);
INSERT INTO answer (answer_body, answer_date, misinformation, author, answer_image, question_id, highlight) VALUES ('Yes, some people are still using Windows 95.\nSome games wont run on anything newer. As well, Windows 95 gets you very close to “real" DOS, even if it isnt an independent, separate DOS; actually, its MS-DOS 7.0, because MS-DOS 6.22 was the last independent DOS that was separate from Windows 3.x.\nSome people have very old computer hardware and apparently:\nthey have never heard of Linux,\ndont know how to use Linux,\nthe application they need to run wont run under WINE (WINE Is Not an Emulator) on Linux and\nwon’t run on any more modern operating system (except possibly in a virtualized environment, as I’ll explain below).\nThey just plain like running Windows 95\nA combination of the above.\nThat’s when Windows 95 is run directly on “bare metal”, as opposed to running it in a virtualized environment. However, it is possible, using either VMware Workstation Player or Oracle VirtualBox, to run Window 95 as a “virtual machine”, or VM. Running an operating system as a VM means that the virtualization software tricks the operating system into thinking it’s running directly on the metal-plastic-and-silicon hardware of a computer, when in fact, though it has an image file to load into RAM, the VM is available only as long as the virtualization software is active and the VM has been started and loaded into RAM.\nIt’s far safer, unless one absolutely must use Windows 95 on bare metal, as in points #3 and #4 above, to run Windows 95 in a virtualized environment. Anyway, Windows 95 won’t run on more modern hardware, and must never run directly on solid-state drive hardware. This is also true of Windows 98, Me, 2000, XP, and Vista (the last of which should never be run period. Ever). These operating systems were not designed for SSD technology and will destroy an SSD very quickly. The only Windows versions that can handle SSDs are Windows 7, 8.0, 8.1, and 10.', TIMESTAMP '2021-03-08 12:00:16', false, 86, NULL, 44, true);
