INSERT INTO answer (answer_body, answer_date, misinformation, author, answer_image, question_id, highlight) VALUES ('I would like to say that Francium is without any doubt one of the craziest elements in the periodic table. It is found all the way down in the alkali metal group and this is one of the main reasons for its amazing properties. The reason behind why elements far down in the alkali metal group are so interesting and crazy, as people say, is because they have a valence electron that lies so far away from the nucleus. Because they have their valence electron far away from the nucleus they sit “looser” because the nucleus doesn’t attract them as hard. Therefore, the electron is more prone to leave the atom and react with other substances.', TIMESTAMP '2020-08-05 03:00:32', false, 87, NULL, 69, false);
INSERT INTO answer (answer_body, answer_date, misinformation, author, answer_image, question_id, highlight) VALUES ('The computer RAM is the short term storage for your CPU. It is volatile which means that once the power to it is cut, all of the data on it is erased. It is a lot faster than your storage or hard drive. It is also directly connected to the CPU which means that the CPU has direct access to it.\nYour hard drive doesn’t have direct access to your CPU. The RAM is like the tool belt and the hard drive is like going to your truck to get something.\nAnother type of storage is cache which is onboard the CPU. This is the fastest type of memory and is even closer to the CPU. The cache only holds about 10MB(depending on the CPU).\nThe cache is like the tools in your hand.', TIMESTAMP '2020-08-27 05:11:39', false, 52, NULL, 70, false);
