INSERT INTO answer (answer_body, answer_date, misinformation, author, answer_image, question_id, highlight) VALUES ('The laws of physics stop computers getting faster forever. Computers calculate at the tick of an internal clock, so for many years manufacturers made transistors smaller and clocks faster to make them perform more computations per second. However, conventional electronics get too hot if you make them calculate too fast, which is why we no longer see clock speeds increasing much. Instead we now have more and more ‘cores’ – lots of processors all calculating in parallel – to let them do more work in the same time. Which means that yes, computers can and will keep getting faster.', TIMESTAMP '2020-05-25 19:15:39', false, 95, NULL, 86, true);
