INSERT INTO answer (answer_body, answer_date, misinformation, author, answer_image, question_id, highlight) VALUES ('The Universe is thought to consist of three types of substance: normal matter, "dark matter" and "dark energy". Normal matter consists of the atoms that make up stars, planets, human beings and every other visible object in the Universe.', TIMESTAMP '2020-10-02 07:49:54', false, 23, NULL, 87, true);
INSERT INTO answer (answer_body, answer_date, misinformation, author, answer_image, question_id, highlight) VALUES ('As of now,we only have thorough knowledge about 5% of the universe,the rest 95% is completely unknown to us. Let me explain it to you in brief -\nBaryonic matter(normal matter)- This is the stuff that you and I are made of.gluons,baryons,quarks are all the fundamental sub atomic particles that go on to make supermassive stars,neutron stars,planets,galaxies and so on.but the interesting thing to know is this is only 5% of our observable universe.\nDark matter- As the name suggests,this is the matter that is totally in dark(unknown)to us right now.it consists of 25% of the critical density of our universe. The field of cosmology, astronomy and the whole astrophysics community has been scratching its heads for quite a long time to know its whereabouts.The problem is that dark matter does not interact with our normal matter as is the case with light.The only thing that makes it possible for us to know about its existence is its gravitational effect on normal matter.scientists and researchers have some assumptions about what it could be like,(WIMPS)weakly interacting massive particles,(SIMPS)strongly interacting massive particles but the right thing to say would be we just dont know yet.\nDark energy - This is the most mysterious form of energy that seems to permeate all of the space(75%).still it is completely unknown to us.we came to know about it through CMB(cosmic microwave background).We know that our universe is expanding since the big bang,but scientists thought that due to the effects of gravity,this expansion will slow down but rather we found that its accelerating. Something is causing it to expand at superluminal rate of speed.This something is what we refer to as dark energy.we do not have any idea on what it could be,but just some hypothesis that its cosmological constant(vacuum energy). scientists are conducting research and experiments on this subject but till now,we havent been able to trace it.', TIMESTAMP '2021-02-03 09:34:32', false, 57, NULL, 87, true);
