INSERT INTO answer (answer_body, answer_date, misinformation, author, answer_image, question_id, highlight) VALUES ('Golden ratio, also known as the golden section, golden mean, or divine proportion, in mathematics, the irrational number (1 + Square root of 5)/2, often denoted by the Greek letters, which is approximately equal to 1.618. It is the ratio of a line segment cut into two pieces of different lengths such that the ratio of the whole segment to that of the longer segment is equal to the ratio of the longer segment to the shorter segment. The origin of this number can be traced back to Euclid, who mentions it as the “extreme and mean ratio” in the Elements. In terms of present day algebra, letting the length of the shorter segment be one unit and the length of the longer segment be x units gives rise to the equation (x + 1)/x = x/1; this may be rearranged to form the quadratic equation x2 – x – 1 = 0, for which the positive solution is x = (1 + Square root of 5)/2, the golden ratio.', TIMESTAMP '2021-01-13 17:47:11', false, 90, NULL, 191, true);
INSERT INTO answer (answer_body, answer_date, misinformation, author, answer_image, question_id, highlight) VALUES ('I dont think if the golden ratio exists..', TIMESTAMP '2021-02-13 02:07:00', false, 87, NULL, 191, true);
INSERT INTO answer (answer_body, answer_date, misinformation, author, answer_image, question_id, highlight) VALUES ('We find the golden ratio when we divide a line into two parts so that: the long part divided by the short part is also equal to the whole length divided by the long part.', TIMESTAMP '2021-02-23 09:46:33', false, 26, NULL, 191, true);
