INSERT INTO answer (answer_body, answer_date, misinformation, author, answer_image, question_id, highlight) VALUES ('Every audio sample has whats known as an "acoustic fingerprint", which (like a human fingerprint) is basically a way to identify music based on things like tempo, bandwidth, and other audio features.\nIt then compares that acoustic fingerprint to the ones in their database, and if there is a "close enough" match, it returns the matched song information.', TIMESTAMP '2021-04-01 01:49:44', false, 14, NULL, 203, true);
INSERT INTO answer (answer_body, answer_date, misinformation, author, answer_image, question_id, highlight) VALUES ('Shazam identifies songs based on an audio fingerprint based on a time-frequency graph called a spectrogram. It uses a smartphone or computer´s built-in microphone to gather a brief sample of audio being played. Shazam stores a catalogue of audio fingerprints in a database. The user tags a song for 10 seconds and the application creates an audio fingerprint. Shazam works by analyzing the captured sound and seeking a match based on an acoustic fingerprint in a database of millions of songs.', TIMESTAMP '2021-03-19 04:17:16', false, 21, NULL, 203, false);
INSERT INTO answer (answer_body, answer_date, misinformation, author, answer_image, question_id, highlight) VALUES ('I think the most realistic mechanism for getting more energy from the sun is to increase biomass energy schemes. Bio energy crops could produce a significant quantity of solar derived energy if the motivation were there.\nBio mass has the following adavantages:\n1. Energy created by burning biomass is CO2 neutral. CO2 produced in combustion is no more than the quantities of CO2 which the bio material broke down while they were growing.\n2. Biomass is incredibly cheap to "manufacture". You just plant seeds.\n3. There is no initial manufacturing energy cost. (For a long time photovoltaic solar cells required far more energy to produce than they could ever hope to recoup in their life.\n4. There are minimal building / construction / equipment area requirements. Large land areas of solar energy collection can be done with woodland / field crops etc. which can still be used for recreational use or production of wood / food etc.\n5. Biomass energy collectors are rarely objected to by environmentalists / Nimbys etc.', TIMESTAMP '2020-06-28 21:31:55', false, 96, NULL, 204, false);
