INSERT INTO answer (answer_body, answer_date, misinformation, author, answer_image, question_id, highlight) VALUES ('Golden ratio, also known as the golden section, golden mean, or divine proportion, in mathematics, the irrational number (1 + Square root of 5)/2, often denoted by the Greek letters, which is approximately equal to 1.618. It is the ratio of a line segment cut into two pieces of different lengths such that the ratio of the whole segment to that of the longer segment is equal to the ratio of the longer segment to the shorter segment. The origin of this number can be traced back to Euclid, who mentions it as the “extreme and mean ratio” in the Elements. In terms of present day algebra, letting the length of the shorter segment be one unit and the length of the longer segment be x units gives rise to the equation (x + 1)/x = x/1; this may be rearranged to form the quadratic equation x2 – x – 1 = 0, for which the positive solution is x = (1 + Square root of 5)/2, the golden ratio.', TIMESTAMP '2020-09-14 05:18:55', false, 36, NULL, 241, true);
INSERT INTO answer (answer_body, answer_date, misinformation, author, answer_image, question_id, highlight) VALUES ('I dont think if the golden ratio exists..', TIMESTAMP '2021-02-25 17:22:59', false, 1, NULL, 241, true);
INSERT INTO answer (answer_body, answer_date, misinformation, author, answer_image, question_id, highlight) VALUES ('We find the golden ratio when we divide a line into two parts so that: the long part divided by the short part is also equal to the whole length divided by the long part.', TIMESTAMP '2020-05-24 10:11:30', false, 21, NULL, 241, true);
INSERT INTO answer (answer_body, answer_date, misinformation, author, answer_image, question_id, highlight) VALUES ('Yes, some people are still using Windows 95.\nSome games wont run on anything newer. As well, Windows 95 gets you very close to “real" DOS, even if it isnt an independent, separate DOS; actually, its MS-DOS 7.0, because MS-DOS 6.22 was the last independent DOS that was separate from Windows 3.x.\nSome people have very old computer hardware and apparently:\nthey have never heard of Linux,\ndont know how to use Linux,\nthe application they need to run wont run under WINE (WINE Is Not an Emulator) on Linux and\nwon’t run on any more modern operating system (except possibly in a virtualized environment, as I’ll explain below).\nThey just plain like running Windows 95\nA combination of the above.\nThat’s when Windows 95 is run directly on “bare metal”, as opposed to running it in a virtualized environment. However, it is possible, using either VMware Workstation Player or Oracle VirtualBox, to run Window 95 as a “virtual machine”, or VM. Running an operating system as a VM means that the virtualization software tricks the operating system into thinking it’s running directly on the metal-plastic-and-silicon hardware of a computer, when in fact, though it has an image file to load into RAM, the VM is available only as long as the virtualization software is active and the VM has been started and loaded into RAM.\nIt’s far safer, unless one absolutely must use Windows 95 on bare metal, as in points #3 and #4 above, to run Windows 95 in a virtualized environment. Anyway, Windows 95 won’t run on more modern hardware, and must never run directly on solid-state drive hardware. This is also true of Windows 98, Me, 2000, XP, and Vista (the last of which should never be run period. Ever). These operating systems were not designed for SSD technology and will destroy an SSD very quickly. The only Windows versions that can handle SSDs are Windows 7, 8.0, 8.1, and 10.', TIMESTAMP '2021-03-12 12:31:43', false, 90, NULL, 242, false);
INSERT INTO answer (answer_body, answer_date, misinformation, author, answer_image, question_id, highlight) VALUES ('I think nobody uses Windows 95 anymore.', TIMESTAMP '2021-02-23 22:20:39', false, 27, NULL, 242, false);
INSERT INTO answer (answer_body, answer_date, misinformation, author, answer_image, question_id, highlight) VALUES ('Yes people still use it, and in more ways than one.\nPeople who use win95 retail version extremely small number, probably for legacy support. Don’t recommend connecting to internet with it, or it’d catch a stupid amount of malware\nPeople who use a modified win95 larger number, but the software is custom built, and there is no rush to modernise it. Generally, they aren’t connected to the internet, and more often than not, they aren’t even on an intranet.\nPeople who use win95 for an unforeseen use this group is pretty small, but they are the cool group. I’ve used it for help with study, I’ve used it for fun, playing older games like doom and of the works.', TIMESTAMP '2021-03-30 16:11:03', false, 61, NULL, 242, true);
