INSERT INTO answer (answer_body, answer_date, misinformation, author, answer_image, question_id, highlight) VALUES ('I would like to say that Francium is without any doubt one of the craziest elements in the periodic table. It is found all the way down in the alkali metal group and this is one of the main reasons for its amazing properties. The reason behind why elements far down in the alkali metal group are so interesting and crazy, as people say, is because they have a valence electron that lies so far away from the nucleus. Because they have their valence electron far away from the nucleus they sit “looser” because the nucleus doesn’t attract them as hard. Therefore, the electron is more prone to leave the atom and react with other substances.', TIMESTAMP '2021-01-14 22:48:20', false, 56, NULL, 246, true);
