INSERT INTO answer (answer_body, answer_date, misinformation, author, answer_image, question_id, highlight) VALUES ('Every audio sample has whats known as an "acoustic fingerprint", which (like a human fingerprint) is basically a way to identify music based on things like tempo, bandwidth, and other audio features.\nIt then compares that acoustic fingerprint to the ones in their database, and if there is a "close enough" match, it returns the matched song information.', TIMESTAMP '2021-03-14 01:26:21', false, 12, NULL, 274, true);
INSERT INTO answer (answer_body, answer_date, misinformation, author, answer_image, question_id, highlight) VALUES ('Shazam identifies songs based on an audio fingerprint based on a time-frequency graph called a spectrogram. It uses a smartphone or computer´s built-in microphone to gather a brief sample of audio being played. Shazam stores a catalogue of audio fingerprints in a database. The user tags a song for 10 seconds and the application creates an audio fingerprint. Shazam works by analyzing the captured sound and seeking a match based on an acoustic fingerprint in a database of millions of songs.', TIMESTAMP '2021-03-12 11:44:12', false, 50, NULL, 274, true);
