INSERT INTO answer (answer_body, answer_date, misinformation, author, answer_image, question_id, highlight) VALUES ('Normally, a person walking on a well-built bridge wont exert enough force to do anything. But when we join forces, so much is possible. Belykh found that when people change their gait en masse, and there are enough people on the bridge to really put some force behind their new movements, they can cause a wobble.', TIMESTAMP '2020-12-24 11:25:37', false, 42, NULL, 289, false);
INSERT INTO answer (answer_body, answer_date, misinformation, author, answer_image, question_id, highlight) VALUES ('Bridges sway from side to side due to wind blowing across them, and they bounce up and down as traf ic or people pass over. Bridges address this swaying and bouncing in much the same manner as trees. When a tree is still a sapling and is hit by strong winds, its elastic nature allows it to bend without cracking.', TIMESTAMP '2020-07-18 06:42:17', false, 27, NULL, 289, false);
