INSERT INTO answer (answer_body, answer_date, misinformation, author, answer_image, question_id, highlight) VALUES ('The computer RAM is the short term storage for your CPU. It is volatile which means that once the power to it is cut, all of the data on it is erased. It is a lot faster than your storage or hard drive. It is also directly connected to the CPU which means that the CPU has direct access to it.\nYour hard drive doesn’t have direct access to your CPU. The RAM is like the tool belt and the hard drive is like going to your truck to get something.\nAnother type of storage is cache which is onboard the CPU. This is the fastest type of memory and is even closer to the CPU. The cache only holds about 10MB(depending on the CPU).\nThe cache is like the tools in your hand.', TIMESTAMP '2020-07-07 00:10:31', false, 89, NULL, 291, false);
INSERT INTO answer (answer_body, answer_date, misinformation, author, answer_image, question_id, highlight) VALUES ('RAM means Random Acces Memory', TIMESTAMP '2020-07-30 10:36:38', false, 7, NULL, 291, false);
INSERT INTO answer (answer_body, answer_date, misinformation, author, answer_image, question_id, highlight) VALUES ('It is a Central Processing Unit.', TIMESTAMP '2020-11-04 16:05:20', false, 23, NULL, 291, true);
