INSERT INTO answer (answer_body, answer_date, misinformation, author, answer_image, question_id, highlight) VALUES ('Some companies take a preference on macbooks over other laptops but usually, it comes down to personal preference. People like macs because MacOS is a Unix underneath and the hardware is really really well built. Another thing is that in the open source community you tend to deploy on Linux servers. Unix and Linux work almost exactly the same way so stuff like shell scripts can easily be developed on your mac and then be used on Linux. Basically, the near-linux experience is the biggest reason some companies prefer macbooks over other laptops.', TIMESTAMP '2020-12-21 15:47:21', false, 33, NULL, 296, false);
INSERT INTO answer (answer_body, answer_date, misinformation, author, answer_image, question_id, highlight) VALUES ('No. Macbooks are overrated and overpriced pieces of equipment that should never be used in software development.', TIMESTAMP '2020-08-21 14:18:04', false, 56, NULL, 296, false);
INSERT INTO answer (answer_body, answer_date, misinformation, author, answer_image, question_id, highlight) VALUES ('Yes, all companies prefer macbooks. There is no reason to ever pick any other laptop over a macbook due to its convenience and near-linux experience.', TIMESTAMP '2020-11-28 00:02:19', false, 39, NULL, 296, true);
INSERT INTO answer (answer_body, answer_date, misinformation, author, answer_image, question_id, highlight) VALUES ('Their lineage is uncertain, but it is believed domestic cats separated from their ancestor, the African Wildcat, 130,000 years ago. They are very similar in appearance and share a lot of common genetics.', TIMESTAMP '2021-03-29 15:35:13', false, 83, NULL, 297, false);
